import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.css";
import DebtComp from "./components/debt";
import BillsComp from "./components/bills";
import CalendarComp from "./components/calendar";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Budgetizer 1.0</h3>
      </header>
      <main className="App-main">
        <div className="row">
          <div className="col-sm">
            <DebtComp />
          </div>
          <div className="col-sm">
            <BillsComp />
          </div>
          <div className="col-sm">
            <CalendarComp />
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
